import React from "react";
function Coin({ name, icon, price, symbol }) {
  return (
    <div className="post-container">
    <h1 className="heading">Name:{name}</h1>
    <img className="image" src={icon} alt="post" />
    <p>{price}</p>
    <div className="info">      
      <h4>Symbol: {symbol}</h4>
    </div>
  </div>
  );
}

export default Coin;
